import './App.css';
import { Routes, Route, Link } from 'react-router-dom'

function App() {
  return (
    <div className="App">
      <Link to="/"><h2>Pokemon Team App</h2></Link>
      <hr />
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="#" element={<CreateTeamPage /> } />
        <Route path="/teams/:id" element={<YourTeamPage />} />
      </Routes>
    </div>
  );
}

export default App;
